cat((select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t),\'T00:00:00.000+00:00\') as folders_cmis_lastmodificationdate,\n (select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t) as folders_lastmodificationdate,\n \'\' as folders_name,\n date_format((select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_documents where alfresco_id = ${alfresco_id} union all select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t),\'%Y-%m-%d\') as document_last_update,\n 0 as document_skip,\n date_format((select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_documents where alfresco_id = ${alfresco_id} union all select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t),\'%Y-%m-%d\') as folder_last_update,\n 0 as folder_skip'),(17518,21,947,0,'limit',0,'0'),(17519,21,947,0,'lookup',0,NULL),(17520,21,947,0,'execute_each_row',0,'N'),(17521,21,947,0,'variables_active',0,'Y'),(17522,21,947,0,'lazy_conversion_active',0,'N'),(17523,21,947,0,'cluster_schema',0,NULL),(17524,21,947,0,'row_distribution_code',0,NULL),(17525,21,948,0,'PARTITIONING_SCHEMA',0,NULL),(17526,21,948,0,'PARTITIONING_METHOD',0,'none'),(17527,21,948,0,'field_name',0,'cmis_last_update'),(17528,21,948,0,'variable_name',0,'cmis_last_update'),(17529,21,948,0,'variable_type',0,'PARENT_JOB'),(17530,21,948,0,'default_value',0,NULL),(17531,21,948,1,'field_name',0,'last_update'),(17532,21,948,1,'variable_name',0,'last_update'),(17533,21,948,1,'variable_type',0,'PARENT_JOB'),(17534,21,948,