20068,53,1025,0,'update_field',0,NULL),(20069,53,1025,0,'delete_field',0,NULL),(20070,53,1025,0,'read_field',0,NULL),(20071,53,1025,0,'sqlFromfile',0,'N'),(20072,53,1025,0,'sendOneStatement',0,'N'),(20073,53,1025,0,'cluster_schema',0,NULL),(20074,53,1025,0,'row_distribution_code',0,NULL),(20075,53,1026,0,'PARTITIONING_SCHEMA',0,NULL),(20076,53,1026,0,'PARTITIONING_METHOD',0,'none'),(20077,53,1026,0,'compatible',0,'N'),(20078,53,1026,0,'optimizationLevel',0,'9'),(20079,53,1026,0,'jsScript_name',0,'Main'),(20080,53,1026,0,'jsScript_script',0,'var query = \"\";\nquery += getInsertsSqlForOperational();\n\n// ==============================================\n\nfunction getInsertsSqlForOperational() {\n\n  var classes = JSON.parse(custom_metadata);\n\n  var query = \"\";\n  for (var  i = 0; i < classes.length; ++i) {\n\n    var class = classes[i];\n\n    var classInfo = getClassInfo(class.name);\n\n    // Table name defintion.\n    var tableName = \"ope_rest_\" + class_type + \"_\" + class.name.replace(\":\", \"_\").trim();\n    if (tableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n      var id = getClassId(class.name);\n      var postfix = \"_\" + id.trim();\n      tableName = tableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n      tableName += postfix;\n    }\n\n    // Insert table command.\n    var query = \"\";\n    query += \"INSERT INTO `\" + tableName + \"` (\";\n\n    // Common fields.\n    query += \"`alfresco_id`,\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += \"`document_node-dbid`,\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += \"`folder_node-dbid`,\";\n    }\n    \n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n      for (property in class.properties[j]) {\n        query += \"`\" + property.replace(\":\", \"_\").trim() + \"`,\";\n      }\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \") VALUES (\";\n\n    // Common fields.\n    query += alfresco_id + \",\";\n    if (class_type.equals(\'documents\') || class_type.equals(\'aspects\')) {\n      query += document_node_dbid + \",\";\n    }\n    if (class_type.equals(\'folders\') || class_type.equals(\'aspects\')) {\n      query += folder_node_dbid + \",\";\n    }\n\n    // Custom fields.\n    for (var  j = 0; j < class.properties.length; ++j) {\n\n      for (property in class.properties[j]) {\n\n        var propertyType = getPropertyType(classInfo, property);\n\n        switch(propertyType) {\n\n          case \"d:boolean\":  query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:date\":     query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"to_date(\'\" + class.properties[j][property].trim() + \"\', \'yyyy-MM-dd\')\"; break;\n          case \"d:datetime\": query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : \"to_timestamp(\'\" + class.properties[j][property].trim() + \"\', \'yyyy-MM-ddTHH:mi:ss.SSS\')\"; break;\n          case \"d:double\":   query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:float\":    query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:int\":      query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:long\":     query += (class.properties[j][property].trim().equals(\'\')) ? \"null\" : class.properties[j][property].trim(); break;\n          case \"d:text\":     query += \"\'\" + class.properties[j][property].replace(/\'/g, \"\'\'\") + \"\'\"; break;\n          default:           query += \"\'\" + class.properties[j][property].replace(/\'/g, \"\'\'\") + \"\'\"; break;\n        }\n\n        query += \",\";\n      }\n\n    }\n    query = query.substring(0, query.length - 1); \n\n    query += \"); \";\n  }\n\n  return query;\n}\n\nfunction getClassInfo(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_metadata_info\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class info not defined for \'\" + className + \"\'.\";\n}\n\nfunction getClassId(className) {\n\n  var metadataInfo = JSON.parse(getVariable(\"custom_classes_ids\",\"\"));\n\n  if (class_type.equals(\"aspects\")) {\n\n    for (var  i = 0; i < metadataInfo.aspects.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.aspects[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.aspects[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n  else {\n\n    for (var  i = 0; i < metadataInfo.types.length; ++i) {\n      for (metadataInfoClassName in metadataInfo.types[i]) {\n        if (className.equals(metadataInfoClassName)) {\n          return metadataInfo.types[i][metadataInfoClassName];\n        }\n      }\n    }\n\n  }\n\n  throw \"Class id not defined for \'\" + className + \"\'.\";\n}\n\nfunction getPropertyType(classInfo, propertyName) {\n\n  for (var  i = 0; i < classInfo.length; ++i) {\n    for (metadataInfoPropertyName in classInfo[i]) {\n      if (propertyName.equals(metadataInfoPropertyName)) {\n        return classInfo[i][metadataInfoPropertyName];\n      }\n    }\n  }\n\n  throw \"Property info not defined for \'\" + propertyName + \"\' into the class \'\" + className + \"\'.\";\n}\n'),(20081,53,1026,0,'jsScript_type',0,NULL),(20082,53,1026,0,'field_name',0,'query'),(20083,53,1026,0,'field_rename',0,'query'),(20084,53,1026,0,'field_type',0,'String'),(20085,53,1026,0,'field_length',-1,NULL),(20086,53,1026,0,'field_precision',-1,NULL),(20087,53,1026,0,'field_replace',0,'N'),(20088,53,1026,0,'cluster_schema',0,NULL),(20089,53,1026,0,'row_distribution_code',0,NULL),(20090,53,1027,0,'PARTITIONING_SCHEMA',0,NULL),(20091,53,1027,0,'PARTITIONING_METHOD',0,'none'),(20092,53,1027,0,'loglevel',0,'log_level_basic'),(20093,53,1027,0,'displayHeader',0,'Y'),(20094,53,1027,0,'logmessage',0,'Please contact sysadmin.'),(20095,53,1027,0,'field_name',0,'query'),(20096,53,1027,0,'cluster_schema',0,NULL),(20097,53,1027,0,'row_distribution_code',0,NULL),(20098,53,1025,0,'step_error_handling_source_step',0,'Execute row SQL script'),(20099,53,1025,0,'step_error_handling_target_step',0,'Write to log'),(20100,53,1025,0,'step_error_handling_is_enabled',0,'Y'),(20101,53,1025,0,'step_error_handling_nr_valuename',0,NULL),(20102,53,1025,0,'step_error_handling_descriptions_valuename',0,NULL),(20103,53,1025,0,'step_error_handling_fields_valuename',0,NULL),(20104,53,1025,0,'step_error_handling_codes_valuename',0,NULL),(20105,53,1025,0,'step_error_handling_max_errors',0,NULL),(20106,53,1025,0,'step_error_handling_max_pct_errors',0,NULL),(20107,53,1025,0,'step_error_handling_min_pct_rows',0,NULL),(20123,55,1030,0,'PARTITIONING_SCHEMA',0,NULL),(20124,55,1030,0,'PARTITIONING_METHOD',0,'none'),(20125,55,1030,0,'id_connection',1,NULL),(20126,55,1030,0,'commit',1,NULL),(20127,55,1030,0,'sql_field',0,'query'),(20128,55,1030,0,'insert_field',0,NULL),(20129,55,1030,0,'update_field',0,NULL),(20130,55,1030,0,'delete_field',0,NULL),(20131,55,1030,0,'read_field',0,NULL),(20132,55,1030,0,'sqlFromfile',0,'N'),(20133,55,1030,0,'sendOneStatement',0,'N'),(20134,55,1030,0,'cluster_schema',0,NULL),(20135,55,1030,0,'row_distribution_code',0,NULL),(20136,55,1031,0,'PARTITIONING_SCHEMA',0,NULL),(20137,55,1031,0,'PARTITIONING_METHOD',0,'none'),(20138,55,1031,0,'id_connection',1,NULL),(20139,55,1031,0,'sql',0,'SELECT\n MIN(id) AS id,\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect,\n CONCAT(\'{\"properties\":[\', GROUP_CONCAT(CONCAT(\'\"\',name,\'\"\') SEPARATOR \',\'), \']}\') AS fields\nFROM\n dm_custom_metadata\nWHERE\n alfresco_id=${alfresco_id}\n AND is_active=\'Y\'\nGROUP BY\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect'),(20140,55,1031,0,'limit',0,'0'),(20141,55,1031,0,'lookup',0,NULL),(20142,55,1031,0,'execute_each_row',0,'N'),(20143,55,1031,0,'variables_active',0,'Y'),(20144,55,1031,0,'lazy_conversion_active',0,'N'),(20145,55,1031,0,'cluster_schema',0,NULL),(20146,55,1031,0,'row_distribution_code',0,NULL),(20147,55,1032,0,'PARTITIONING_SCHEMA',0,NULL),(20148,55,1032,0,'PARTITIONING_METHOD',0,'none'),(20149,55,1032,0,'compatible',0,'N'),(20150,55,1032,0,'optimizationLevel',0,'9'),(20151,55,1032,0,'jsScript_name',0,'Main'),(20152,55,1032,0,'jsScript_script',0,'var query = \"\";\nquery += getSqlForDimension();\n\n// ==============================================\n\nfunction getSqlForDimension() {\n\n  // Operational table name.\n  var opeTableName = \"ope_rest_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    opeTableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    opeTableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    opeTableName += \"aspects\";\n  }\n  opeTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (opeTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    opeTableName = opeTableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    opeTableName += postfix;\n  }\n\n  // Dimension table name.\n  var dimTableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    dimTableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    dimTableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    dimTableName += \"aspects\";\n  }\n  dimTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (dimTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    dimTableName = dimTableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    dimTableName += postfix;\n  }\n\n  var fieldsJson = JSON.parse(fields);\n  var properties = fieldsJson.properties;\n\n  var query = \"\";\n\n  if (is_document_subtype.equals(\'Y\') || is_aspect.equals(\'Y\')) {\n\n    // Insert command.\n    query += \"INSERT INTO `\" + dimTableName + \"` (\";\n\n    // Field list.\n    query += \"document_id,\";\n    if (is_aspect.equals(\'Y\')) {\n      query += \"folder_id,\";\n    }\n    query += \"prog,\";\n\n	for (i in properties) {\n      query += \"`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \"`alfresco_id`,\";\n    query += \"`src_id`\";\n\n    query += \") \";\n\n    // Select command.\n    query += \" SELECT \";\n    query += \"d.id AS document_id,\";\n    if (is_aspect.equals(\'Y\')) {\n      query += \"null AS folder_id,\";\n    }\n    query += \"1 AS prog,\";\n\n	for (i in properties) {\n      query += \"`\" + properties[i].replace(\":\", \"_\").trim() + \"`,\";\n    }\n\n    query += \"o.alfresco_id AS alfresco_id,\";\n    query += \"o.`document_node-dbid` AS src_id\";\n\n    query += \" FROM \";\n    query += \"`\" + opeTableName + \"` AS o\";\n    query += \" JOIN `dm_dim_documents` AS d ON d.alfresco_id = o.alfresco_id AND d.src_id = o.`document_node-dbid`\";\n    query += \" WHERE \";\n    query += \"o.alfresco_id = \" + getVariable(\"alfresco_id\