\n -1 as creation_minute_id,\n \'UNKNOWN\'as user_last_modifier,\n date(\'2000-01-01\') as last_modification_date_id,\n -1 as last_modification_minute_id,\n 0 as size,\n -1 as parent_id\nunion all\nselect\n stg_rest_documents.alfresco_id as alfresco_id,\n stg_rest_documents.`node-dbid` as src_id,\n stg_rest_documents.`store-protocol` as \"store-protocol\",\n stg_rest_documents.`store-identifier` as \"store-identifier\",\n stg_rest_documents.`node-uuid` as \"node-uuid\",\n name as \"name\",\n coalesce(path,\'Unknown\') as path,\n type as node_type,\n coalesce(upper(mimetype),\'UNKNOWN\') as mime_type,\n coalesce(upper(creator),\'UNKNOWN\') as user_creator,\n date(created) as creation_date_id,\n (extract(hour from created) * 60) + extract(minute from created) as creation_minute_id,\n upper(modifier)as user_last_modifier,\n date(modified) as last_modification_date_id,\n (extract(hour from modified) * 60) + extract(minute from modified) as last_modification_minute_id,\n size as size,\n -1 as parent_id\nfrom\n stg_rest_documents\nwhere\n stg_rest_documents.alfresco_id = ${alfresco_id}\n and stg_rest_documents.created is not null\n'),(21326,7,1121,0,'limit',0,'0'),(21327,7,1121,0,'lookup',0,NULL),(21328,7,1121,0,'execute_each_row',0,'N'),(21329,7,1121,0,'variables_active',0,'Y'),(21330,7,1121,0,'lazy_conversion_active',0,'N'),(21331,7,1121,0,'cluster_schema',0,NULL),(21332,7,1121,0,'row_distribution_code',0,NULL),(21333,59,1122,0,'PARTITIONING_SCHEMA',0,NULL),(21334,59,1122,0,'PARTITIONING_METHOD',0,'none'),(21335,59,1122,0,'id_connection',1,NULL),(21336,59,1122,0,'commit',1,NULL),(21337,59,1122,0,'sql_field',0,'query'),(21338,59,1122,0,'insert_field',0,NULL),(21339,59,1122,0,'update_field',0,NULL),(21340,59,1122,0,'delete_field',0,NULL),(21341,59,1122,0,'read_field',0,NULL),(21342,59,1122,0,'sqlFromfile',0,'N'),(21343,59,1122,0,'sendOneStatement',0,'N'),(21344,59,1122,0,'cluster_schema',0,NULL),(21345,59,1122,0,'row_distribution_code',0,NULL),(21346,59,1123,0,'PARTITIONING_SCHEMA',0,NULL),(21347,59,1123,0,'PARTITIONING_METHOD',0,'none'),(21348,59,1123,0,'id_connection',1,NULL),(21349,59,1123,0,'sql',0,'SELECT\n MIN(id) AS id,\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect,\n CONCAT(\'{\"properties\":[\', GROUP_CONCAT(CONCAT(\'\"\',name,\'\"\') SEPARATOR \',\'), \']}\') AS fields\nFROM\n dm_custom_metadata\nWHERE\n alfresco_id=${alfresco_id}\n AND is_active=\'Y\'\nGROUP BY\n class,\n is_document_subtype,\n is_folder_subtype,\n is_aspect'),(21350,59,1123,0,'limit',0,'0'),(21351,59,1123,0,'lookup',0,NULL),(21352,59,1123,0,'execute_each_row',0,'N'),(21353,59,1123,0,'variables_active',0,'Y'),(21354,59,1123,0,'lazy_conversion_active',0,'N'),(21355,59,1123,0,'cluster_schema',0,NULL),(21356,59,1123,0,'row_distribution_code',0,NULL),(21357,59,1124,0,'PARTITIONING_SCHEMA',0,NULL),(21358,59,1124,0,'PARTITIONING_METHOD',0,'none'),(21359,59,1124,0,'compatible',0,'N'),(21360,59,1124,0,'optimizationLevel',0,'9'),(21361,59,1124,0,'jsScript_name',0,'Main'),(21362,59,1124,0,'jsScript_script',0,'var query = \"\";\nquery += getSqlForDimension();\n\n// ==============================================\n\nfunction getSqlForDimension() {\n\n  // Operational table name.\n  var opeTableName = \"ope_rest_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    opeTableName += \"documents\";\n  }\n  else if (is_folder_subtype.equals(\'Y\')) {\n    opeTableName += \"folders\";\n  }\n  else if (is_aspect.equals(\'Y\')) {\n    opeTableName += \"aspects\";\n  }\n  opeTableName += \"_\" + class.replace(\":\", \"_\").trim();\n  if (opeTableName.length > parseInt(getVariable(\"table_name_max_length\",\"\"))) {\n    var postfix = \"_\" + id.trim();\n    opeTableName = opeTableName.substr(0, parseInt(getVariable(\"table_tame_max_length\",\"\")) - postfix.length);\n    opeTableName += postfix;\n  }\n\n  // Dimension table name.\n  var dimTableName = \"dm_dim_\";\n  if (is_document_subtype.equals(\'Y\')) {\n    dimTableName += \"documents\";\n  }\n  else if 