, (select u2.id from dm_dim_users u2 where u2.alfresco_id = ${alfresco_id} and u2.src_user = \'UNKNOWN\')) as initiator_id,\n upper(stg_workflow_instances.isactive) as is_active,\n coalesce(date(stg_workflow_instances.startdate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as start_date_id,\n coalesce((extract(hour from stg_workflow_instances.startdate) * 60) + extract(minute from stg_workflow_instances.startdate),-1) as start_minute_id,\n coalesce(date(stg_workflow_instances.duedate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as due_date_id,\n coalesce((extract(hour from stg_workflow_instances.duedate) * 60) + extract(minute from stg_workflow_instances.duedate),-1) as due_minute_id,\n coalesce(date(stg_workflow_instances.enddate), str_to_date(\'2000-01-01\',\'%Y-%m-%d\')) as end_date_id,\n coalesce((extract(hour from stg_workflow_instances.enddate) * 60) + extract(minute from stg_workflow_instances.enddate),-1) as end_minute_id,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.enddate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as duration,\n round(coalesce(timediff(str_to_date(stg_workflow_instances.duedate,\'%Y-%m-%dT%H:%i:%s\'),str_to_date(stg_workflow_instances.startdate,\'%Y-%m-%dT%H:%i:%s\'))/60,0)) as max_duration,\n case when stg_workflow_instances.enddate is null then concat(dm_dim_alfresco.url,\'/alfresco/service/api/workflow-instances/\',stg_workflow_instances.id,\'/diagram\') else \'Unknown\' end as diagram_url,\n coalesce(dm_dim_workflow_definitions.id, (select w2.id from dm_dim_workflow_definitions w2 where w2.alfresco_id = ${alfresco_id} and w2.url = \'Unknown\')) as definition_id\nfrom\n stg_workflow_instances\n join dm_dim_alfresco on stg_workflow_instances.alfresco_id = dm_dim_alfresco.id\n left join dm_dim_users on dm_dim_users.alfresco_id = dm_dim_alfresco.id and dm_dim_users.src_user = upper(stg_workflow_instances.initiator)\n left join dm_dim_workflow_definitions on dm_dim_workflow_definitions.alfresco_id = dm_dim_alfresco.id and dm_dim_workflow_definitions.url = stg_workflow_instances.definitionurl\nwhere\n stg_workflow_instances.alfresco_id = ${alfresco_id}\n\n'),(21802,41,1141,0,'limit',0,'0'),(21803,41,1141,0,'lookup',0,NULL),(21804,41,1141,0,'execute_each_row',0,'N'),(21805,41,1141,0,'variables_active',0,'Y'),(21806,41,1141,0,'lazy_conversion_active',0,'N'),(21807,41,1141,0,'cluster_schema',0,NULL),(21808,41,1141,0,'row_distribution_code',0,NULL),(21809,41,1142,0,'PARTITIONING_SCHEMA',0,NULL),(21810,41,1142,0,'PARTITIONING_METHOD',0,'none'),(21811,41,1142,0,'id_connection',1,NULL),(21812,41,1142,0,'sql',0,'select \n dm_dim_workflow_instances.alfresco_id as alfresco_id,\n dm_dim_workflow_instances.id as id\nfrom\n dm_dim_workflow_instances\nwhere\n dm_dim_workflow_instances.alfresco_id = ${alfresco_id}\n and dm_dim_workflow_instances.is_active = \'TRUE\'\n and dm_dim_workflow_instances.src_id not in (\n  select stg_workflow_instances.id\n  from stg_workflow_instances\n  where stg_workflow_instances.alfresco_id = ${alfresco_id}\n )'),(21813,41,1142,0,'limit',0,'0'),(21814,41,1142,0,'lookup',0,NULL),(21815,41,1142,0,'execute_each_row',0,'N'),(21816,41,1142,0,'variables_active',0,'Y'),(21817,41,1142,0,'lazy_conversion_active',0,'N'),(21818,41,1142,0,'cluster_schema',0,NULL),(21819,41,1142,0,'row_distribution_code',0,NULL),(21820,42,1143,0,'PARTITIONING_SCHEMA',0,NULL),(21821,42,1143,0,'PARTITIONING_METHOD',0,'none'),(21822,42,1143,0,'id_connection',1,NULL),(21823,42,1143,0,'commit',0,'1000'),(21824,42,1143,0,'schema',0,NULL),(21825,42,1143,0,'table',0,'dm_dim_workflow_items'),(21826,42,1143,0,'key_name',0,'alfresco_id'),(21827,42,1143,0,'key_field',0,'alfresco_id'),(21828,42,1143,0,'key_condition',0,'='),(21829,42,1143,0,'key_name2',0,NULL),(21830,42,1143,1,'key_name',0,'workflow_instance_id'),(21831,42,1143,1,'key_field',0,'workflow_instance_id'),(21832,42,1143,1,'key_condition',0,'='),(21833,42,1143,1,'key_name2',0,NULL),(21834,42,1143,2